use rhai::def_package;
use rhai::packages::{ ArithmeticPackage, BasicArrayPackage, BasicMapPackage, LogicPackage
};
use rhai::plugin::*; // Define plugin module.
#[export_module]
mod my_plugin_module { pub const MY_NUMBER: i64 = 42; pub fn greet(name: &str) -> String { format!("hello, {}!", name) } // Non-public functions are by default not exported. fn get_private_num() -> i64 { 42 } pub fn get_num() -> i64 { get_private_num() } // This is a sub-module, but if using 'combine_with_exported_module!', // it will be flattened and all functions registered at the top level. // // Because of the flattening, sub-modules are very convenient for // putting feature gates onto large groups of functions. #[cfg(feature = "sub-num-feature")] pub mod my_sub_module { pub fn get_sub_num() -> i64 { 0 } }
