There is one global namespace for every Engine , which includes (in the following search order): all functions defined in the AST currently being evaluated, all native Rust functions and iterators registered via the Engine::register_XXX API, all functions and iterators defined in global modules that are registered into the Engine via register_global_module, functions defined in modules registered into the Engine via register_static_module that are specifically marked for exposure to the global namespace (e.g. via the #[rhai(global)] attribute in a plugin module ). functions defined in imported modules that are specifically marked for exposure to the global namespace (e.g. via the #[rhai(global)] attribute in a plugin module ). Anywhere in a Rhai script, when a function call is made, the function is searched within the global namespace, in the above search order. Therefore, function calls in Rhai are late bound – meaning that the function called cannot be determined or guaranteed; there is no way to lock down the function being called. This aspect is very similar to JavaScript before ES6 modules. // Compile a script into AST
