The trick is to differentiate between multiple identical copies of Rhai, each having a different features set, by their sources : Different versions from crates.io – The official crate. Different releases from GitHub – Crate source on GitHub. Forked copy of https://github.com/rhaiscript/rhai on GitHub. Local copy of https://github.com/rhaiscript/rhai downloaded form GitHub. Use the following configuration in Cargo.toml to pull in multiple copies of Rhai within the same project: [dependencies]
rhai = { version = "1.7.0", features = [ "no_float" ] }
rhai_github = { git = "https://github.com/rhaiscript/rhai", features = [ "unchecked" ] }
rhai_my_github = { git = "https://github.com/my_github/rhai", branch = "variation1", features = [ "serde", "no_closure" ] }
rhai_local = { path = "../rhai_copy" } The example above creates four different modules: rhai, rhai_github, rhai_my_github and rhai_local, each referring to a different Rhai copy with the appropriate features set. Only one crate of any particular version can be used from each source, because Cargo merges all candidate cases within the same source, adding all features together. If more than four different instantiations of Rhai is necessary (why?), create more local repositories or GitHub forks or branches. No way To avoid dependency conflicts Unfortunately, pulling in Rhai from different sources do not resolve the problem of features conflict between dependencies. Even overriding crates.io via the [patch] manifest section doesn't work – all dependencies will eventually find the only one copy. What is necessary – multiple copies of Rhai, one for each dependent crate that requires it, together with their unique features set intact. In other words, turning off Cargo's crate merging feature just for Rhai . Unfortunately, as of this writing, there is no known method to achieve it. Therefore, moral of the story: avoid pulling in multiple crates that depend on Rhai.

