Variables in Rhai follow normal C naming rules – must contain only ASCII letters, digits and underscores _. Character set Description A ... Z Upper-case ASCII letters a ... z Lower-case ASCII letters 0 ... 9 Digit characters _ Underscore character However, a variable name must also contain at least one ASCII letter, and an ASCII letter must come before any digits. In other words, the first character that is not an underscore _ must be an ASCII letter and not a digit. Why this restriction? To reduce confusion (and subtle bugs) because, for instance, _1 can easily be misread (or mistyped) as -1. Rhai is dynamic without type checking, so there is no compiler to catch these typos. Therefore, some names, e.g. _, _42foo, _1 etc., are not valid in Rhai. For example: c3po and _r2d2_ are valid variable names, but 3abc and ____49steps are not. Variable names are case sensitive . Variable names also cannot be the same as a keyword (active or reserved). Avoid names longer than 11 letters on 32-Bit Rhai inlines a string, which avoids allocations unless it is over its internal limit (23 ASCII characters on 64-bit, but only 11 ASCII characters on 32-bit). On 64-bit systems, most variable names are shorter than 23 letters, so this is unlikely to become an issue. However, on 32-bit systems, take care to limit, where possible, variable names to within 11 letters. This is particularly true for local variables inside a hot loop, where they are created and destroyed in rapid succession. // The following is SLOW on 32-bit
